import  React from 'react';

import styles from './table-row.module.css';

const TableRow =()=> {
    
        return (
            <div>
               
            
            <div className={styles.data_body} >
               <div className={styles.data_name} >
                   <span></span>
               </div>
               <div className={styles.data_name} >
                   <span></span>
               </div>
               <div className={styles.data_name} >
                   <span>Total</span>
               </div>
               <div className={styles.data_name} >
                   <span>250</span>
               </div>
               <div className={styles.data_name} >
                   <span></span>
               </div>
               </div>
            </div>
        );
    
}

export default TableRow;
